    false,nt"url": null,nt"notes": "The Satellite View with Shaded Relief of
    the Conterminous United States map layer is a 100-meter resolution simulated natural-color
    image of the United States, with relief shading added to accentuate terrain features.
    Vegetation is generally green, with forests in darker green and grasslands or shrublands
    in lighter green. Areas of high reflectance, including urban areas, rock, and dry
    bare soil, are shown in shades of tan and pink. Very bright areas, such as snow
    and ice, are light blue. The image was produced by combining a mosaic of Landsat
    Thematic Mapper (TM) imagery from the Landsat 4 and Landsat 5 satellites with shaded
    relief generated from 100-meter elevation data extracted from the National Elevation
    Dataset (NED).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
